import { createStructuredSelector } from 'reselect';
import { createPokerHomepageSelector, IPokerHomepageContainerState } from '../../shared';

export const pokerHomepageSelector = createStructuredSelector<IPokerHomepageContainerState>({
  clientId: createPokerHomepageSelector('clientId'),
  clientName: createPokerHomepageSelector('clientName')
});
